(, 'Betterbanc', 'A friendlier take on capital', 'It\'s the fastest way to grow your business. Access fast, flexible funding to grow your business from R20 000 - R1,000,000', 'It\'s the fastest way to grow your business. Access fast, flexible funding to grow your business from R20 000 - R1,000,000\r\n Access the capital you need within 24 hours.\r\n Apply today and get access to R20 000 – R1,000,000.\r\n Outgrow your competitors.', '', 0, 'https://betterbanc.co/'),
(, 'Business Structures', '5 Different Types Of South African Business Structures', 'Do you know which type of business will suit your South African business idea best? Here are the five different types you can register your business as.', 'Are you looking to start a business? There are numerous ways you can structure your new business, which will play a part in how you run it and who you answer to.\r\n\r\nIf you’re a group starting a business together, or one founder going it alone, you should know the benefits and drawbacks of each structural type. Here are the 5 different types of business structures and how they will impact your business:\r\n\r\n1. Sole Proprietorship\r\nA sole proprietorship is when there is a single founder who owns and runs the business. This is the simplest form of business entity because the business is not separate from the owner.\r\n\r\nYou can give your business a trading name, and only you have the authority to make', '', 0, 'https://www.entrepreneur.com/article/335080');

