(, 'Ludhiana', 'Ludhiana, February 5', 'The Punjab Sports Department will organise selection trials in 18 sports disciplines to register players (boys and girls U-14, 16 and 19) with the school sports wings in Ludhiana district on February 11 and 12', 'The Punjab Sports Department will organise selection trials in 18 sports disciplines to register players (boys and girls U-14, 16 and 19) with the school sports wings in Ludhiana district on February 11 and 12.\r\n\r\nIn a press release today, Ravinder Singh, district sports officer (DSO), Ludhiana, said these trials would be held at five venues across the district to select players for enrolment in the 2021-22 session.\r\n\r\nTrials for archery will be held at GHG Khalsa College, Gurusar Sadhar, and for hockey, handball and cycling at Punjab Agricultural University, Ludhiana, on February 11 and 12.', '', 0, 'https://www.tribuneindia.com/news/ludhiana/trials-for-school-sport-wings-on-february-11-12-in-ludhiana-208660');

