('', 'SA\'s Got Talent', 'South Africa\'s Got Talent', 'SA\'s Got Talent (also known as South Africa\'s Got Talent or shorten to SAGT) was a South African television ahow that aired on e.tv and part of the Got Talent series.', 'SA\'s Got Talent (also known as South Africa\'s Got Talent or shorten to SAGT) was a South African television ahow that aired on e.tv and part of the Got Talent series. It was presented by Mo Mahlangu, popularly known as Tol Ass Mo. Singers, dancers, comedians, variety acts, and other performers competed against each other for audience support. The winner of each series received R500,000 (R250,000 in Seasons 1 to 5). The first series of the talent show began on 1 October 2009 and was broadcast weekly with a live semi-finals and final on 12 November 2009.', '', 0, 'https://o3schools.com/sas-got-talent/');

